import React from 'react';

import Menu from './Menu';


function Home() {
    return (<div className="home"><Menu onNavigation={onNavigation} />
    <div className="Title">
      <h1>Kevin's Website</h1>
      {getCurrentPage()}
    </div></div>);
}

export default Home;
